import React, { Suspense } from "react";
import MainLayout from "./modules/main";
import { CSSReset, ThemeProvider } from "@chakra-ui/core";
import CustomTheme from "./theme";
import { SWRConfig } from "swr";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import ListHeading from "./modules/common/ListHeading";
import List from "./modules/common/list";
import SuspenseFallback from "./modules/common/SuspenseFallback";

function App() {
  return (
    <SWRConfig
      value={{
        revalidateOnFocus: false
      }}
    >
      <Router>
        <ThemeProvider theme={CustomTheme}>
          <CSSReset />
          <MainLayout>
            <Switch>
              <Route exact path="/">
                <ListHeading
                  title="Marvel characters list"
                  subtitle="Browse details and add then to your favorites"
                />
                <Suspense fallback={<SuspenseFallback />}>
                  <List />
                </Suspense>
              </Route>
            </Switch>
          </MainLayout>
        </ThemeProvider>
      </Router>
    </SWRConfig>
  );
}

export default App;
